export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:d,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:d,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},P3bOEDZT1Z:{data:{id:2700,attributes:{imdbId:"tt1325004",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDMwNjAzNzYwOF5BMl5BanBnXkFtZTcwMDY5NzcyMw@@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"5.0\u002F10"},{Source:"Rotten Tomatoes",Value:"48%"},{Source:"Metacritic",Value:"58\u002F100"}],item_lang:{data:{id:3363,attributes:{title:"The Twilight Saga: Eclipse",plot:"Bella once again finds herself surrounded by danger as Seattle is ravaged by a string of mysterious killings and a malicious vampire continues her quest for revenge. In the midst of it all, she is forced to choose between her love for Edward and her friendship with Jacob -- knowing that her decision has the potential to ignite the struggle between vampire and werewolf. With her graduation quickly approaching, Bella is confronted with the most important decision of her life.",slug:"the-twilight-saga-eclipse"}}},books:{data:[{id:1663,attributes:{title:"Eclipse",description:"As the love triangle heats up in the third book, Bella must choose between her friendship with Jacob and her romance with Edward -- and her decision could change the fate of vampires and werewolves forever. As Seattle is ravaged by a string of mysterious killings and a malicious vampire continues her quest for revenge, Bella once again finds herself surrounded by danger. In the midst of it all, she is forced to choose between her love for Edward and her friendship with Jacob -- knowing that her decision has the potential to ignite the ageless struggle between vampire and werewolf. With her graduation quickly approaching, Bella has one more decision to make: life or death. But which is which? It's here! #1 bestselling author Stephenie Meyer makes a triumphant return to the world of Twilight with the highly anticipated companion, Midnight Sun: the iconic love story of Bella and Edward told from the vampire's point of view. \"People do not want to just read Meyer's books; they want to climb inside them and live there.\" -- Time \"A literary phenomenon.\" -- The New York Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6ZY5AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2007-08-07",publisher:f,subtitle:b}},{id:1664,attributes:{title:"The Short Second Life Of Bree Tanner",description:"Fans of The Twilight Saga will be enthralled by the riveting story of Bree Tanner, a character introduced in Eclipse, and the darker side of the newborn vampire world she inhabits. In another irresistible combination of danger, mystery and romance, Stephenie Meyer tells the devastating story of Bree and the newborn army as they prepare to close in on Bella Swan and the Cullens, following their encounter to its unforgettable conclusion. 'I'm as surprised as anyone about this novella,' said Stephenie Meyer. 'When I began working on it in 2005, it was simply an exercise to help me examine the other side of Eclipse, which I was editing at the time. I thought it might end up as a short story that I could include on my website. Then, when work started on The Twilight Saga: The Official Guide, I thought the Guide would be a good fit for my Bree story. However, the story grew longer than I anticipated, until it was too long to fit into the Guide.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-Gvz4gjjgQ8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2010-06-05",publisher:f,subtitle:"An Eclipse Novella"}},{id:1665,attributes:{title:"Eclipse: Twilight Series Book #3",description:b,thumbnail:b,authors:[c],firstBook:e,published:"2007-01-01",publisher:b,subtitle:b}},{id:1666,attributes:{title:"Twilight",description:"Fall in love with the addictive, suspenseful love story between a teenage girl and a vampire with the book that sparked a \"literary phenomenon\" and redefined romance for a generation (New York Times). Isabella Swan's move to Forks, a small, perpetually rainy town in Washington, could have been the most boring move she ever made. But once she meets the mysterious and alluring Edward Cullen, Isabella's life takes a thrilling and terrifying turn. Up until now, Edward has managed to keep his vampire identity a secret in the small community he lives in, but now nobody is safe, especially Isabella, the person Edward holds most dear. The lovers find themselves balanced precariously on the point of a knife -- between desire and danger. Deeply romantic and extraordinarily suspenseful, Twilight captures the struggle between defying our instincts and satisfying our desires. This is a love story with bite. It's here! #1 bestselling author Stephenie Meyer makes a triumphant return to the world of Twilight with the highly anticipated companion, Midnight Sun: the iconic love story of Bella and Edward told from the vampire's point of view. \"People do not want to just read Meyer's books; they want to climb inside them and live there.\" -- Time \"A literary phenomenon.\" -- The New York Times",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PY40AQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:e,published:"2007-07-18",publisher:f,subtitle:b}},{id:1667,attributes:{title:"Twilight Tenth Anniversary\u002FLife and Death Dual Edition",description:"Celebrate the tenth anniversary of Twilight with this special double-feature book! This new edition pairs the classic love story with Stephenie Meyer's bold and surprising reimagining of the complete novel with the characters' genders reversed. In Life and Death, readers will be thrilled to experience this iconic tale told through the eyes of a human teenage boy in love with a female vampire. Packaged as an oversize, jacketed hardcover \"flip book,\" this edition features nearly 400 pages of new content as well as exquisite new cover art. Fans of Bella and Edward will not want to miss the opportunity to see these iconic characters portrayed in intriguing new roles. Twilight has enraptured millions of readers since its first publication in 2005 and has become a modern classic, redefining genres within young adult literature and inspiring a phenomenon that has had readers yearning for more. The novel was a #1 New York Times bestseller, a #1 USA Today bestseller, a Time magazine Best Young Adult Book of All-Time, an NPR Best Ever Teen Novel, and a New York Times Editor's Choice. The Twilight Saga, which also includes New Moon, Eclipse, Breaking Dawn, The Short Second Life of Bree Tanner: An Eclipse Novella, and The Twilight Saga: The Official Illustrated Guide, has sold nearly 155 million copies worldwide.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rm4WswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:e,published:"2015-10-06",publisher:"Little, Brown Books for Young Readers",subtitle:b}}]}}},meta:{}}},prerenderedAt:1688531241819}}("movie","","Stephenie Meyer","series",null,"Hachette UK",1))